/**
 * Provide a distance filter based from a center point with a radius
 * in miles
 * @param lat
 * @param lng
 * @param miles
 * @param latField
 * @param lngField
 */
public DistanceFilter(double lat, double lng, double miles, String latField, String lngField){
  distance = miles;
  this.lat = lat;
  this.lng = lng;
  this.latField = latField;
  this.lngField = lngField;
}

